export const defaultCard = {
  name: "Default title",
  description: "",
  strength: 0,
  health: 0,
  category: "default"
};

class Card {
  constructor(health) {
    this.health = health;
    this.currentHealth = health;
  }

  get currentHealth() {
    console.log("wesh", this.health);
  }

  set currentHealth(value) {
    return value;
  }
}

const toto = new Card(5);

toto.health = 10;
const bla = toto.currentHealth;

